import React, { useState } from 'react';
import axios from 'axios';
import '../styleForm.css'; // Asegúrate de que el archivo de estilos CSS esté importado correctamente

const ContactForm = () => {
  const [name, setName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [subject, setSubject] = useState('');
  const [message, setMessage] = useState('');
  const [isEmailValid, setIsEmailValid] = useState(true);

  const handleNameChange = (event) => setName(event.target.value);
  const handleLastNameChange = (event) => setLastName(event.target.value);
  const handlePhoneChange = (event) => setPhone(event.target.value);
  const handleEmailChange = (event) => {
    setEmail(event.target.value);
    setIsEmailValid(true); // Reestablecer el estado del correo electrónico válido
  };
  const handleSubjectChange = (event) => setSubject(event.target.value);
  const handleMessageChange = (event) => setMessage(event.target.value);

  const handleSubmit = (event) => {
    

    event.preventDefault();

    // Validar el correo electrónico
    if (!validateEmail(email)) {
      setIsEmailValid(false);
      return;
    }

    // Hacer la solicitud POST al backend para insertar los datos en la base de datos
    const data = {
      nombre: name,
      apellido: lastName,
      tel: phone,
      mail: email,
      asunto: subject,
      mensaje: message,
    };

    axios.post('/api/formulario', data)
      .then((response) => {
        console.log(response.data.message);
        // Aquí puedes agregar lógica adicional si lo deseas, como mostrar una notificación de éxito.
      })
      .catch((error) => {
        console.error('Error al enviar el formulario: ', error);
        // Aquí puedes agregar lógica adicional si lo deseas, como mostrar un mensaje de error.
      });
  };

  const validateEmail = (email) => {
    // Función para validar el correo electrónico utilizando una expresión regular simple
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return emailRegex.test(email);
  };
  

  return (
    <>

    <div className="contact-container">
      <div className="contenido">
        <div>
          <h1>Formulario de Contacto</h1>
        </div>
        <form className="formulario" name="formulario" onSubmit={handleSubmit}>
          <div className="contacto">
            <label htmlFor="nombre">Nombre: </label>
            <input
              type="text"
              placeholder="Jhon"
              required
              value={name}
              onChange={handleNameChange}
            />
            <label htmlFor="apellido">Apellido: </label>
            <input
              type="text"
              placeholder="Wick"
              required
              value={lastName}
              onChange={handleLastNameChange}
            />

            <label htmlFor="tel">Telefono: </label>
            <input
              type="tel"
              required
              value={phone}
              onChange={handlePhoneChange}
            />
            <label htmlFor="mail">Mail: </label>
            <input
              type="email"
              required
              value={email}
              onChange={handleEmailChange}
            />
            {!isEmailValid && (
              <p style={{ color: "red" }}>Por favor, ingresa un correo válido.</p>
            )}
          </div>
          <div className="work">
            <h2>Asunto</h2>
            <textarea
              type="text"
              maxLength="300"
              value={subject}
              onChange={handleSubjectChange}
            ></textarea>
          </div>
          <div className="descripcion">
            <h2>Mensaje: </h2>
            <textarea
              type="text"
              maxLength="300"
              value={message}
              onChange={handleMessageChange}
              placeholder="Cuentanos de que se trata..."
            ></textarea>
          </div>
          <div className="botones">
            <button type="submit" form="formulario" value="Submit">
              Enviar
            </button>
          </div>
        </form>
      </div>
    </div>
    </>
  );
};

export default ContactForm;
